import './App.css';
import {Homepage, RegisterPage} from './components';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/Register' element={<RegisterPage />} />
        <Route path='/Homepage' element={<Homepage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
